nível médio; magistério; certificado de conclusão do ensino médio com base no resultado do Exame
Nacional do Ensino Médio - ENEM, ou de exame nacional para certificação de competências de
jovens e adultos - ENCCEJA ou de exames de certificação de competência ou de avaliação de jovens
e adultos realizados pelos sistemas estaduais de ensino);
h) 02 fotos 3x4 recentes e iguais.

